import { useEffect } from "react";
import { useState } from "react";


function AppHeader(){
    return(
        <div>
        <nav className="main-header navbar navbar-expand navbar-lightblue">
        <ul className="navbar-nav">
            <li className="nav-item">
            </li>
            <li className="nav-item d-none d-sm-inline-block">
                <span className="nav-link text-white">รายงานผู้ใช้น้ำที่ยังไม่ได้ตั้งหนี้ กปภ.ข.2</span>
            </li>
        </ul>
        <ul className="navbar-nav ml-auto">
            <li className="nav-item">
                <div className="nav-link text-white" data-widget="navbar-search" href="#" role="button">
                    <span className="text-white"><i className="fas fa-user" />  <button className="btn btn-sm btn-danger" ><i className="fas fa-power-off" /></button></span>
                </div>
            </li>
        </ul>
        </nav>

        </div>
    );
}

export default AppHeader;
